          "text": [
            "<div style=\"text-align:center;\">WESTERN SYDNEY WOMEN’S ORAL HISTORY PROJECT<br /><br /></div>\n<div style=\"text-align:center;\">\"FROM FARMS TO FREEWAYS -<br />WOMEN'S MEMORIES OF WESTERN SYDNEY\"</div>\n<br />The Women's Research Centre has been awarded an Australian Research Council Small Grant to conduct a historical and sociological investigation of the lives of women in the Western Sydney region during the period of rapid suburbanisation after World War II.<br /><br />Women who have lived in the Penrith or Blacktown areas from the late 1940's through the '50's and into the '60's are sought to take part in this project. The oral history interviews seek information from women on their everyday experiences during this period of rapid change and on how the changes affected their lives.<br /><br />Anyone who might be interested to share their memories of these times or anyone who would like more information can contact:<br /><br />Dr. Deborah Chambers,<br />Women’s Research Centre<br />(02) 678-7375 (message) or (02) 678-7352<br /><br />OR Robyn Arrowsmith (02) 389-8397."
